import React from 'react'
import './App.css'
import Header from "./Components/Header/Header";
import Navbar from "./Components/Navbar/Navbar";
import NumericInput from "./Components/NumericField/NumericField";
import Profile from "./Components/Profile/Profile";
import Dialogs from "./Components/Dialogs/Dialogs";
import {BrowserRouter, Route} from "react-router-dom";
import Music from "./Components/NewsMusicSettings/Music";
import News from "./Components/NewsMusicSettings/News";
import Settings from "./Components/NewsMusicSettings/Settings";
// import { useRouter } from 'next/router'
// import Link from 'next/link'

let ProfileComponent = () => <Profile/>;

let posts = [
    {id: 1, message: 'Hi how are you?', likesCount: 10},
    {id: 2, message: 'It is my 1st post', likesCount: 15},
    {id: 2, message: 'Haha how are you mate?', likesCount: 18},
    {id: 2, message: 'Sweet as!', likesCount: 46},
]

const App = (props) => {
    return (
        <BrowserRouter>
            <div className='appWrapper'>
                <Header/>
                <Navbar/>

                {/*For routing purposes*/}
                <div className="appWrapperContent">
                    {/*<Route path="/profile" component={Profile}/>*/}
                    {/*<Route path="/dialogs" component={Dialogs}/>*/}
                    {/*<Route path="/news" component={News}/>*/}
                    {/*<Route path="/music" component={Music}/>*/}
                    {/*<Route path="/settings" component={Settings}/>*/}

                    <Route path="/profile" component={ProfileComponent}/>
                    {/*the way to do it if defining on top*/}
                    <Route path="/dialogs" render={() => <Dialogs/>}/>
                    <Route path="/news" render={() => <News/>}/>
                    <Route path="/music" render={() => <Music/>}/>
                    <Route path="/settings" render={() => <Settings/>}/>
                </div>
                {/*for testing purposes*/}
                {/*<NumericInput/>*/}
            </div>
        </BrowserRouter>
    );
}

export default App;
